var map;$(document).ready(function(){map=new GMaps({div:"#mapHolder",zoom:12,lat:51.379444,lng:-2.365556}),$("#submit-options").click(function(){var o=$("#start").val(),a=$("#destination").val();GMaps.geocode({address:o,callback:function(o,t){if("OK"==t){var e=o[0].geometry.location;console.log(e),GMaps.geocode({address:a,callback:function(o,a){if("OK"==a){var t=o[0].geometry.location;map.drawRoute({origin:[e.k,e.A],destination:[t.k,t.A],strokeColor:"#131540",travelMode:"bicycling",strokeOpacity:.5,strokeWeight:3})}}})}}})})});